import React from "react";
import './Circle.css';

function Circle4(){
    return (
        <>
        <div id="1" className="yellowCircle"></div>
        <div id="2" className="yellowCircle"></div>
        <div id="3" className="yellowCircle"></div>
        <div id="4" className="yellowCircle"></div>
        <div id="5" className="greyCircle"></div>

        </>
    )
}

export default Circle4;
